  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sherburne
  National Wildlife Refuge summarizes Refuge activities during the 1993 calendar year.
  The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the management plan, compliance with environmental and cultural resource mandates,
  research, and investigations. Refuge administration is outlined; information about
  personnel, youth programs, manpower programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered. Subjects
  include wetlands, forests, grasslands, fire management, pest control, and private
  lands. The wildlife section of the report discusses wildlife diversity, endangered
  species, threatened species, waterfowl, marsh birds, waterbirds, game mammals, scientific
  collections, animal control, marking, banding, and disease control. The public uses
  of the Refuge described in this report include outdoor classrooms, interpretive
  exhibits, hunting, fishing, trapping, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment utilization/replacement, and communications systems.
  Cooperative programs are provided at the end.\",\n\t\"license_title\": \"License
